import {AppBar, Typography, Toolbar, Container} from '@material-ui/core'
import {SocialIcon} from 'react-social-icons'
import './../styles/footer.css'

export default function Footer() {
    return (
        <AppBar style = {{background: "#252525"}} position="static" color="primary">
            {/* <Container> */}
            <div className="footerStyle">
                <Toolbar>
                {/* <Typography variant="body1" color="inherit">
                    &copy; <h4 className="logo">2021 Generic CSP Solver</h4> 
                </Typography>    */}
                <h4 className="contactus">Contact Us:</h4>
                <div className="aboutus">
                    <SocialIcon url="http://linkedin.com/in/sanskar-mani-5a8431174/?originalSubdomain=in" />
                    <SocialIcon url="http://linkedin.com/in/dhruv-vaishnav-923aa91b6/" /> 
                </div>
                </Toolbar>
            {/* </Container> */}
        </div>
        </AppBar>
    )
}
